void DrawLogo(){
    int min,r,c;
    
    LCD.SetDrawColor(YELLOW);
    for (r = 75; r < 175; r++){
        c = 0;
        while(c < 320){
            min = 320;
            while (connect4_img_data[r*320 + c] != 21 && c < 320){
                c++;
            }
            min = c;
            while (connect4_img_data[r*320 + c] == 21 && c < 320){
                c++;
            }
            if(min != 320){
                LCD.DrawHorizontalLine(r,min,c);
            }
        }
    }

    LCD.SetDrawColor(RED);
    for (r = 75; r < 175; r++){
        c = 0;
        while(c < 320){
            min = 320;
            while (connect4_img_data[r*320 + c] != 2 && c < 320){
                c++;
            }
            min = c;
            while (connect4_img_data[r*320 + c] == 2 && c < 320){
                c++;
            }
            if(min != 320){
                            LCD.DrawHorizontalLine(r,min,c);
            }
        }
    }

    LCD.SetDrawColor(WHITE);
    for (r = 75; r < 175; r++){
        c = 0;
        while(c < 320){
            min = 320;
            while (connect4_img_data[r*320 + c] != 1 && c < 320){
                c++;
            }
            min = c;
            while (connect4_img_data[r*320 + c] == 1 && c < 320){
                c++;
            }
            if(min != 320){
                            LCD.DrawHorizontalLine(r,min,c);
            }
        }
    }
}